import React from 'react'
import "./CourseCard.css" 
import { Link } from 'react-router-dom';



const CourseCard = ({item}) => {

    console.log(item);

  return (
    <div className='CourseCard__container'>
        <div className='CourseCard__container-img__container'>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSkUDnfpAQOP583f_wJ4lvmqvBxwfASe7CcZQ&s" alt="" />
            <div className='CourseCard__level'>Nivo 1</div>
        </div>

        <div className='CourseCard__container-info_container'>
            <h3>{item.title}</h3>
            <p>{item.description}</p> 
            <Link to={"/kurs/1"} className='CourseCard__container-info_container-button'><button className='CourseCard__container-info_container-link'>Detaljnije</button></Link>
        </div>
    </div>
  )
}

export default CourseCard
